import './ErrorModal.css'

function ErrorModal() {
    const show = false
    const error = true

    if (show) {
        return (
            <div className="error-modal">
                <div
                    className={`error-modal-dialog ${
                        error ? 'error-green' : 'error-red'
                    }`}
                >
                    <i className="error-close-button">&times;</i>
                    <h1 className="error-modal__title">Error</h1>
                    <p className="error-modal__message">There was an error.</p>
                </div>
            </div>
        )
    } else {
        return null
    }
}

export default ErrorModal
